	 	// 	console.log('kwahi');
	 	// 	location.reload();
 		// }

	}

 	render () {

    	return(
    		<Layout>   
    			<Parent artists={data} news={newsData} store={store}/>				
  			</Layout>
    	)
 	 }

}

export default Index;
